import React, { useState } from 'react';
import axios from 'axios';

function InscriptionForm({ onAddSuccess }) {
  const [candCpf, setCandCpf] = useState('');
  const [vagaCodigo, setVagaCodigo] = useState('');

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await axios.post('http://localhost:4000/api/inscricoes', {
        cand_cpf: candCpf,
        pk_vaga_codigo: vagaCodigo
      });
      onAddSuccess();
      console.log('Inscrição adicionada:', response.data);
    } catch (error) {
      console.error('Erro ao adicionar inscrição:', error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>
          CPF do Candidato:
          <input type="text" value={candCpf} onChange={e => setCandCpf(e.target.value)} required />
        </label>
      </div>
      <div>
        <label>
          Código da Vaga:
          <input type="text" value={vagaCodigo} onChange={e => setVagaCodigo(e.target.value)} required />
        </label>
      </div>
      <button type="submit">Inscrever Candidato</button>
    </form>
  );
}

export default InscriptionForm;
